import React from 'react'


import { Main, Section, Sticky } from './styles'

function Form(){
    return(
      <>
      {/* 16 vezes o tamanho da tela */}
      <Main style={{ height:'1610vb'}}>
        <Section style={{ height:'72.7%'}}>

        </Section>

        <Section>
            <Sticky className="third"/>
        </Section>

        <Section>
            <Sticky className="fourth"/>
        </Section>
      </Main>
      </>
    );

}

export default Form;
